import * as React from 'react';
import './Style.css';

function App() {
  return (
    <div className='container'>
      <div className='navbar scrollbar__none'>
        <div className='navbar__top'>
          <div className='navbar__header'></div>
        </div>
        <div className='navbar__bottom'></div>
      </div>
    </div>
  );
}

export default App;
